import React from "react";

 const Cardtemplate = props => {

    return(
        <div style={{backgroundColor:props.bgcolor, color:this.props.textcolor}} className="card">
            <img src={require(`./../images/${this.props.comma}`)} alt="profile1" className="comma" />
            <p className="description">{this.props.description}</p>
            <div className="pic-name">
                <img src={require(`./../images/${this.props.imgurl}`)} alt="profile2" className="image" />
                <div className="name">{this.props.name}</div>
            </div>
        </div>
    )
}
export default Cardtemplate;
